const galleries = document.querySelectorAll('ul.fb-gallery-five');
const mobileBreakpoint = 767;

function updateGalleryCount() {
  galleries.forEach((gallery) => {
    const isMobile = window.innerWidth <= mobileBreakpoint;
    const visibles = isMobile ? 3 : 5;
    const targetElement = isMobile ? 4 : 6;
    const cantidadLi = gallery.querySelectorAll('li').length;
    const more = cantidadLi - visibles;

    // Select either 4th or 6th element based on viewport
    const targetLi = gallery.querySelector(`li:nth-child(${targetElement}) a`);

    if (targetLi) {
      targetLi.setAttribute("count_more", "Zobacz " + more + "+ zdjęć");
    }
  });
}

// Run on page load
updateGalleryCount();

// Run on resize
window.addEventListener('resize', updateGalleryCount);
</script>

