#brxe-mckrjx form.cart button {
  display: flex;
  flex-direction: row;
  align-items: center;
  gap: var(--product-gap);
  margin: 0;
}

/* Add to cart Button Styling */
#brxe-mckrjx form.cart button:not(.added_to_cart) {
  background-color: var(--base);
  border-color: var(--base);
  color: var(--base-ultra-light);  
