#brxe-mckrjx .added_to_cart {
  align-self: center;
  height: auto;
  padding: 0;  
}

/* Add to Cart with no Variation */
#brxe-mckrjx form.cart:not(.variations_form),
/* Add to Cart with Variation */
#brxe-mckrjx form.cart .woocommerce-variation-add-to-cart{
  display: flex;
  flex-direction: column;
  gap: var(--product-gap);
}

/* Add to Cart Wrapper with Variation */
#brxe-mckrjx form.variations_form:not(.cart) {
  display: flex;
  flex-direction: column;
  gap: var(--space-s);
}

#brxe-mckrjx form.cart,
#brxe-mckrjx .single_variation_wrap {
  display: flex;
  flex-direction: column;
  gap: var(--space-s);
}

/* Remove default margin-bottom styling */
#brxe-mckrjx form.cart .woocommerce-variation,
#brxe-mckrjx form.cart table.variations {
  margin: 0;
}

/* Quantity Styling */
#brxe-mckrjx form.cart .quantity {
  display: flex;
  margin: 0;
  border-color: var(--button-color);
  border-width: var(--btn-border-size);
  border-radius: var(--radius-s);
  border-style: solid;
  width: var(--quantity-width);
  line-height: var(--btn-line-height);  
  letter-spacing: var(--btn-letter-spacing);
  text-transform: var(--btn-text-transform);
  text-decoration: var(--btn-text-decoration);
  font-style: var(--btn-text-style);
  font-weight: var(--btn-weight);
}

/* Remove default border of Quantity */
#brxe-mckrjx form.cart .quantity .action,
#brxe-mckrjx form.cart .quantity input {
  border: 0;
}

/* Icons Quantity */
#brxe-mckrjx form.cart .quantity .minus svg,
#brxe-mckrjx form.cart .quantity .plus svg {
  height: 1.5em;
  width: 1.5em;
  color: black;
}

/* Remove Quantity when out of stock */
#brxe-mckrjx[data-woo-stock="1"] > form > .quantity {
	display: none;
}

/* Variation Table */
#brxe-mckrjx table.variations tr {
  display: flex;
  flex-direction: row;
  justify-content: left;
  align-items: center;
  flex-wrap: wrap;
  gap: 0.0rem;
