}

#brxe-mckrjx select option {
  padding: 8px 16px !important;
}

#brxe-mckrjx select a, #brxe-mckrjx .reset_variations {
  display: none !important;
}

#brxe-mckrjx form.variations_form.cart {
  width: 100%;
